  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Okefenokee National
  Wildlife Refuge outlines Refuge accomplishments from May through August of 1954.
  The report begins by summarizing the weather conditions, water conditions, and wildfires
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, fish, and reptiles- is also covered. The physical development
  and maintenance section discusses physical developments. The public relations section
  of the report describes recreational uses, Refuge visitors, and violations. N-R
  forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
